import ExpenseItem from './components/ExpenseItem'

function App() {
  const expenses = [
    { 
      id: e1,
      title: 'Car Insurance',
      amount:3000,
      date: new Date(2021, 2, 28) 
    },
    { title: 'Tolet Paper', amount:120, date: new Date(2021, 2, 28) },
    { title: 'Detergent', amount:100, date: new Date(2021, 2, 28) },
    { title: 'Fernet Branca', amount:750, date: new Date(2021, 2, 28) },
  ];

  return (
    <div>
      <h2>Components</h2>
        <ExpenseItem>title={expenses[0].title}
          amount={expenses[0].amount}
          date={expenses[0].date}
        </ExpenseItem>
        <ExpenseItem>title={expenses[1].title}
          amount={expenses[1].amount}
          date={expenses[1].date}
        </ExpenseItem><ExpenseItem>title={expenses[2].title}
          amount={expenses[2].amount}
          date={expenses[2].date}
        </ExpenseItem><ExpenseItem>title={expenses[3].title}
          amount={expenses[3].amount}
          date={expenses[3].date}
        </ExpenseItem>
    </div>
  );
}

export default App;
